new LoadableDetachableModel<Map<String,String>>(){
  @Override protected Map<String,String> load(){
    Map<String,String> choices;
    OneContext oneContext=new OneContext(MultiChoiceEditor.this);
    OneContext.push(oneContext);
    try {
      io.onedev.server.web.editable.annotation.ChoiceProvider choiceProvider=descriptor.getPropertyGetter().getAnnotation(io.onedev.server.web.editable.annotation.ChoiceProvider.class);
      Preconditions.checkNotNull(choiceProvider);
      Object result=ReflectionUtils.invokeStaticMethod(descriptor.getBeanClass(),choiceProvider.value());
      if (result instanceof List) {
        choices=new LinkedHashMap<>();
        for (        String each : (List<String>)result)         choices.put(each,each);
      }
 else {
        choices=(Map<String,String>)result;
      }
    }
  finally {
      OneContext.pop();
    }
    return choices;
  }
}

