new TextField<String>("title",new IModel<String>(){
  @Override public void detach(){
  }
  @Override public String getObject(){
    if (pullRequest.getTitle() == null) {
      List<Commit> commits=commitsModel.getObject();
      Preconditions.checkState(!commits.isEmpty());
      if (commits.size() == 1)       pullRequest.setTitle(commits.get(0).getSubject());
 else       pullRequest.setTitle(pullRequest.getSource().getName());
    }
